import React from "react";
import '../hoja-de-estilos/Navegacion.css';

/* Todo componente debe iniciar con mayusculas*/
function Navegacion(){
    return(
        <div className="contenedor-principal">
            <div className="contenedor-texto">
                <nav class="navegacion">
                    <a href="index.html">Inicio</a> |
                    <a href={`Producto.js`}>Servicio</a> |
                    <a href="conocenos.html">Conocenos</a> |
                    <a href="contacto.html">Contactenos</a> |
                    <a href="https://www.google.com/" target="_blank" rel="noopener">Buscador</a>
                </nav>
            </div>
        </div>
    );};

export default Navegacion;
